d1a-94fd-89535098985f'),(258,258,1,'Blog (Datastar)','blog-datastar','blog-datastar','{\"b999da82-f3cc-42df-bf8b-7302ef816953\": \"<p class=\\\"ui-teaser\\\">The Datastar-powered Blog showcases how you can build <strong>dynamic, reactive interfaces in Craft CMS  without any JavaScript frameworks</strong>. Using the Datastar plugin, the blog demonstrates features like <strong>category filtering</strong>, <strong>infinite load-more pagination</strong>, and <strong>real-time UI updates</strong>, all written directly in Twig.</p><p>Theres no need for Vue, React, or Alpine  DataStar takes care of the reactivity by leveraging HTML attributes and a lightweight JavaScript layer. This makes it ideal for developers who want <strong>snappy, interactive experiences</strong> while keeping Craft templates fully server-rendered and easy to maintain.</p><p>Each filter or button click triggers an AJAX patch request that replaces or appends elements using Twig partials  preserving accessibility and SEO. The setup is minimal, performant, and perfectly suited for blogs, listings, or search components inside Craft CMS projects.</p><p>In short: <strong>a modern, Alpine-style experience  built purely in Twig</strong>.</p>\", \"c67defbb-160e-48ab-9dc8-7a4dc6e8db58\": \" Blog (Datastar)\"}',1,'2025-10-06 12:38:42','2025-10-09 12:56:41','2cbe0d36-f5ba-4bb5-baac-80f3bfe05f39'),(259,259,1,'Blog - Datastar','blog-datastar','blog-datastar','{\"b999da82-f3cc-42df-bf8b-7302ef816953\": \"<p>Sed posuere consectetur est at lobortis. Aenean lacinia bibendum nulla sed consectetur. Integer posuere erat a ante venenatis dapibus posuere velit aliquet. Fusce dapibus, tellus ac cursus commodo, tortor mauris condimentum nibh, ut fermentum massa justo sit amet risus. Donec ullamcorper nulla non metus auctor fringilla.</p>\", \"c67defbb-160e-48ab-9dc8-7a4dc6e8db58\": \"Blog - Datastar\"}',1,'2025-10-06 12:39:05','2025-10-06 12:39:05','01ca2683-6c26-458c-a3ea-425af91477c9'),(260,260,1,'Design','design',NULL,'{\