68'),(304,304,1,NULL,'__temp_xmyryjgfvmihfecdlkmvkhurafqliwjajpcz',NULL,'{\"54ea783f-26e8-4a98-a119-9a041012aa68\": \"<p class=\\\"ui-teaser\\\">A modern, production-ready Craft CMS Starter Kit with Vite, Tailwind, Vue Web Components, Datastar, GraphQL and DDEV  perfect for agencies and freelancers who want to build clean and fast Craft sites..</p><p>This starter kit helps developers quickly spin up clean and maintainable Craft CMS projects. It includes ready-made examples for Matrix Blocks, CKEditor integration, a Datastar-powered Search page, and both Datastar- and Vue-based blog listings.</p><p><strong> Built with modern tools and clean architecture</strong></p><ul><li> <strong>Craft CMS 5</strong>  latest version with flexible content modeling</li><li> <strong>Vite</strong>  fast bundling and instant reloads</li><li> <strong>DDEV</strong>  reproducible local development environment</li><li> <strong>Datastar</strong>  lightweight, reactive frontend for dynamic UIs</li><li> <strong>Leaflet</strong>  interactive, data-driven maps with clustering and live filtering</li><li> <strong>Vue 3 (Web Components)</strong>  progressive enhancement with custom elements</li><li> <strong>GraphQL</strong>  structured data fetching directly from Craft</li><li> <strong>Tailwind CSS v4</strong>  utility-first styling with CSS variables</li><li> <strong>Anime.js</strong>  smooth element animations and scroll-based transitions</li><li> <strong>Craft eagerly() + render()</strong>  optimized queries, automatic block templates, and smart caching</li><li><strong> SEO-Ready JSON-LD Organization Schema </strong> structured data for Google Rich Results</li><li> <strong>SEO Meta, Open Graph &amp; Sitemap </strong> powered by SEOMate for share-friendly pages</li><li> <strong>Plugins:</strong> CKEditor, Datastar, Map, Image Resizer, SEOMate, Vite</li></ul><p> Feel free to explore, fork, or contribute  this starter kit is open source and available on GitHub.</p>\"}',1,'2025-10-06 13:19:41','2025-11-07 11:45:40','caa8a6d9-4aec-4254-928e-e1a8d38ab6b4'),(305,305,1,NULL,'__temp_xkxefblkbqrrpgdsmxpjqahpwwtxucyulfla',NULL,'{\"0f59f188-6699-4347-a393-7cc6ddd680fc\": false}',1,'2025-10-06 13:19:41','2025-10-06 13:19:41','dce8e3e5-1128-4951-bd3d-565127123ee0'),(306,306,1,NULL,'__temp_ymqpcozflkswyiztejqhscgrwkbbvylnvwoy',NULL,'{\"4ca0b060-ab25-4210-ba7a-04339db07b5d\": \" Matrix Builder\", \"b68b894d-8c8e-4fc8-af1c-45b45dfc82d5\": {\"type\": \"entry\", \"label\": \"Read more\", \"value\": \"{entry:12@1:url}\", \"ariaLabel\": \"Read more about the Matrix Builder \"}, \"e07011df-84b0-4504-8c98-7af8c534248c\": [], \"e3da269c-60c2-4d60-9a98-718ef293562c\": \"<p>Build flexible page layouts using Crafts Matrix field. Each component can be placed freely within the custom Grid Layout system.</p>\"}',1,'2025-10-06 13:19:41','2025-10-10 08:49:11','7bb1627f-2fa1-40d9-962c-11cef7bd176d'),(307,307,1,NULL,'__temp_rookcbakctclekveurvtcgllabmfytnayywb',NULL,'{\"4ca0b060-ab25-4210-ba7a-04339db07b5d\": \" CKEditor Builder\", \"b68b894d-8c8e-4fc8-af1c-45b45dfc82d5\": {\"type\": \"entry\", \"label\": \"Read more\", \"value\": \"{entry:99@1:url}\"}, \"e07011df-84b0-4504-8c98-7af8c534248c\": [], \"e3da269c-60c2-4d60-9a98-718ef293562c\": \"<p>Insert predefined components directly into CKEditor. A simple example of combining structured elements and rich text content.</p>\"}',1,'2025-10-06 13:19:41','2025-10-07 10:46:30','9b029f72-9efd-4106-b7ae-b64ad5aa4b66'),(308,308,1,NULL,'__temp_wivzvacapfdmeujajaupvewukwdvqvhisguk',NULL,'{\"4ca0b060-ab25-4210-ba7a-04339db07b5d\": \" Datastar Blog\", \"b68b894d-8c8e-4fc8-af1c-45b45dfc82d5\": {\"type\": \"entry\", \"label\": \"Read more\", \"value\": \"{entry:258@1:url}\"}, \"e07011df-84b0-4504-8c98-7af8c534248c\": [], \"e3da269c-60c2-4d60-9a98-718ef293562c\": \"<p>A dynamic blog built with Craft DataStar. Features live filtering, pagination, and instant content updates without page reloads.</p>\"}',1,'2025-10-06 13:19:41','2025-11-07 11:43:48','83e738