,'blog-datastar','{\"b999da82-f3cc-42df-bf8b-7302ef816953\": \"<p class=\\\"ui-teaser\\\">The DataStar-powered Blog showcases how you can build <strong>dynamic, reactive interfaces in Craft CMS  without any JavaScript frameworks</strong>. Using the <a href=\\\"https://putyourlightson.com/plugins/datastar\\\">DataStar module</a>, the blog demonstrates features like <strong>category filtering</strong>, <strong>infinite load-more pagination</strong>, and <strong>real-time UI updates</strong>, all written directly in Twig.</p><p>Theres no need for Vue, React, or Alpine  DataStar takes care of the reactivity by leveraging HTML attributes and a lightweight JavaScript layer. This makes it ideal for developers who want <strong>snappy, interactive experiences</strong> while keeping Craft templates fully server-rendered and easy to maintain.</p><p>Each filter or button click triggers an AJAX patch request that replaces or appends elements using Twig partials  preserving accessibility and SEO. The setup is minimal, performant, and perfectly suited for blogs, listings, or search components inside Craft CMS projects.</p><p>In short: <strong>a modern, Alpine-style experience  built purely in Twig</strong>.</p>\", \"c67defbb-160e-48ab-9dc8-7a4dc6e8db58\": \" Blog (Datastar)\"}',1,'2025-10-07 10:32:52','2025-10-07 10:32:52','faf69a70-2d8d-4109-a811-7158f4c7095b'),(562,562,1,'Blog (Datastar)','blog-datastar','blog-datastar','{\"b999da82-f3cc-42df-bf8b-7302ef816953\": \"<p class=\\\"ui-teaser\\\">The DataStar-powered Blog showcases how you can build <strong>dynamic, reactive interfaces in Craft CMS  without any JavaScript frameworks</strong>. Using the DataStar plugin, the blog demonstrates features like <strong>category filtering</strong>, <strong>infinite load-more pagination</strong>, and <strong>real-time UI updates</strong>, all written directly in Twig.</p><p>Theres no need for Vue, React, or Alpine  DataStar takes care of the reactivity by leveraging HTML attributes and a lightweight JavaScript layer. This makes it ideal for developers who want <strong>snappy, interactive experiences</strong> while keeping Craft templates fully server-rendered and easy to maintain.</p><p>Each filter or button click triggers an AJAX patch request that replaces or appends elements using Twig partials  preserving accessibility and SEO. The setup is minimal, performant, and perfectly suited for blogs, listings, or search components inside Craft CMS projects.</p><p>In short: <strong>a modern, Alpine-style experience  built purely in Twig</strong>.</p>\", \"c67defbb-160e-48ab-9dc8-7a4dc6e8db58\": \" Blog (Datastar)\"}',1,'2025-10-07 10:33:19','2025-10-07 10:33:19','5b7474f8-386b-49eb-aa23-787151b33628'),(563,563,1,NULL,NULL,NULL,'{\"9bd2388d-d293-4f1b-8283-61a80c29e4ac\": \"Blog Demo  Vue Web Component + GraphQL in Craft CMS\", \"f9112d3e-b4f8-4c57-bbba-1c369f98698d\": \"A modern blog demo using Vue 3, GraphQL, and Vite. Includes live filtering, pagination, and reusable web components built directly into Craft CMS.\", \"fb364fbf-e22b-4dbe-8570-724df7c5e068\": []}',1,'2025-10-07 10:37:19','2025-10-08 07:59:09','a1897654-4e83-4dec-9245-d2338e8261b2'),(565,565,1,'Blog (Vue)','blog-vue','blog-vue','{\"d5e6d8c8-d270-4cb5-9e6f-84c64de0bafa\": \"<p class=\\\"ui-teaser\\\">The Vue-powered Blog demonstrates how you can build <strong>fully reactive and API-driven content experiences</strong> in Craft CMS using <strong>Vue 3 as a Web Component</strong>.</p><p>Instead of relying on Twig and DataStar, this version fetches all entries and categories dynamically via the <strong>Craft CMS GraphQL API</strong>  no Craft plugins required. It features <strong>category filtering</strong>, <strong>lazy loading</strong>, and <strong>load more pagination</strong>, all handled client-side with reactive state management. Editors still manage content in Crafts control panel, while the front end consumes it as structured GraphQL data  making it ideal for <strong>hybrid projects</strong> that blend Crafts authoring comfort with modern JavaScript flexibility.</p><p>This approach provides a great example of how <strong>Vue can be used progressively inside Craft</strong>, without needing a separate frontend build or headless setup. Everything compiles into a <strong>single lightweight custom element</strong>, ready to drop into any Twig template.</p>\", \"f8fa90ba-e624-4c6b-82e5-806c7c869935\": \" Blog (Vue)\"}',1,'2025-10-07 10:38:11','2025-10-07 10:38:11','6b5b6fef-fc63-4cf6-b20a-08cd36f54583'),(566,566,1,NULL,NULL,NULL,NULL,1,'2025-10-07 10:38:11','2025-10-07 10:38:11','3982c40b-f17d-4ed6-adb6-bb97fd7ee0d9'),(567,567,1,NULL,NULL,NULL,'{\"9bd2388d-d293-4f1b-8283-61a80c29e4ac\": \"Craft CMS Boilerplate  Modern Starter Kit with Vite, Tailwind & Datastar\", \"f9112d3e-b4f8-4c57-bbba-1c369f98698d\": \"A modern Craft CMS boilerplate featuring Vite, Tailwind CSS, Vue 3, Datastar, and GraphQL. Built for developers and agencies looking for a fast, scalable, and beautifully structured starting point for new Craft projects.\", \"fb364fbf-e22b-4dbe-8570-724df7c5e068\": [700]}',1,'2025-10-07 10:41:47','2025-10-09 09:39:48','eb81ecfc-c93b-4e6e-b662-07346231d0a4'),(570,570,1,'Home','home','__home__','{\"872f39e9-c6e7-4db6-9915-33944177d829\": \"CraftCMS Lazy \\nA simple Craft CMS Starter Kit\"}',1,'2025-10-07 10:42:24','2025-10-07 10:42:24','f534853e-6853-4605-969c-5fd49c3cc25a'),(571,571,1,NULL,NULL,NULL,NULL,1,'2025-10-07 10:42:24','2025-10-07 10:42:24','9cd56731-5a18-4b5c-86de-e9d225efd385'),(572,572,1,NULL,'__temp_xmyryjgfvmihfecdlkmvkhurafqliwjajpcz',NULL,'{\"54ea783f-26e8-4a98-a119-9a041012aa68\": \"<p class=\\\"ui-teaser\\\">This starter kit is designed to help developers quickly spin up clean and maintainable Craft CMS projects. It includes ready-made examples for Matrix Blocks, CKEditor integration, and both DataStar- and Vue-powered blog listings.</p><p>Built with Tailwind CSS and a flexible grid layout system, it provides a solid foundation for buildin