 reactive live rendering for Twig templates</li><li> <strong>Image Resizer</strong>  automatic image optimization and responsive transforms</li><li> <strong>SEOMate</strong>  SEO metadata, Open Graph, and sitemap integration</li><li> <strong>Vite Plugin</strong>  connects Vite dev server seamlessly with Craft CMS</li></ul>\"}',1,'2025-10-07 11:07:16','2025-10-07 11:07:16','4c0aeb35-7c78-4bf8-ba5a-436be660fd0e'),(641,641,1,'Blog (Datastar)','blog-datastar','blog-datastar','{\"b999da82-f3cc-42df-bf8b-7302ef816953\": \"<p class=\\\"ui-teaser\\\">The DataStar-powered Blog showcases how you can build <strong>dynamic, reactive interfaces in Craft CMS  without any JavaScript frameworks</strong>. Using the DataStar plugin, the blog demonstrates features like <strong>category filtering</strong>, <strong>infinite load-more pagination</strong>, and <strong>real-time UI updates</strong>, all written directly in Twig.</p><p>Theres no need for Vue, React, or Alpine  DataStar takes care of the reactivity by leveraging HTML attributes and a lightweight JavaScript layer. This makes it ideal for developers who want <strong>snappy, interactive experiences</strong> while keeping Craft templates fully server-rendered and easy to maintain.</p><p>Each filter or button click triggers an AJAX patch request that replaces or appends elements using Twig partials  preserving accessibility and SEO. The setup is minimal, performant, and perfectly suited for blogs, listings, or search components inside Craft CMS projects.</p><p>In short: <strong>a modern, Alpine-style experience  built purely in Twig</strong>.</p>\", \"c67defbb-160e-48ab-9dc8-7a4dc6e8db58\": \" Blog (Datastar)\"}',1,'2025-10-07 11:09:45','2025-10-07 11:09:45','ae71b49a-dbae-4d9b-89b4-45f96a17f3a0'),(644,644,1,'Home','home','__home__','{\"872f39e9-c6e7-4db6-9915-33944177d829\": \"CraftCMS Lazy \\nA simple Craft CMS Starter Kit\"}',1,'2025-10-07 11:14:19','2025-10-07 11:14:19','dd6c1d61-2c32-42a1-a06f-b54c6bc8442f'),(645,645,1,NULL,