n Graph, and sitemap integration</li><li> <strong>Vite Plugin</strong>  connects Vite dev server seamlessly with Craft CMS</li></ul>\"}',1,'2025-10-07 11:14:19','2025-10-07 11:14:19','a8098418-38e0-40c7-a710-8060386a9a1f'),(648,648,1,'Home','home','__home__','{\"872f39e9-c6e7-4db6-9915-33944177d829\": \"CraftCMS Lazy \\nA simple Craft CMS Starter Kit\"}',1,'2025-10-07 11:14:40','2025-10-07 11:14:40','2f26fcc1-d11e-4d58-8d31-f80594b32e88'),(649,649,1,NULL,'__temp_xmyryjgfvmihfecdlkmvkhurafqliwjajpcz',NULL,'{\"54ea783f-26e8-4a98-a119-9a041012aa68\": \"<p class=\\\"ui-teaser\\\">This starter kit is designed to help developers quickly spin up clean and maintainable Craft CMS projects. It includes ready-made examples for Matrix Blocks, CKEditor integration, and both DataStar- and Vue-powered blog listings.</p><p>This boilerplate is designed to demonstrate a clean, scalable, and modern Craft CMS setup  perfect for agencies, freelancers, and developers who want a strong starting point for new projects. Everything runs locally with DDEV, built with Vite, styled with Tailwind, and powered by real content through DataStar or Vue components.</p><h3><strong> Tech Stack</strong></h3><ul><li> <strong>Craft CMS 5</strong>  latest version with sections, Matrix fields &amp; full headless support</li><li> <strong>Vite</strong>  modern asset bundler with instant hot reload and Vue integration</li><li> <strong>DDEV</strong>  Docker-based local dev environment for PHP, MySQL &amp; HTTPS</li><li> <strong>Tailwind CSS</strong>  utility-first styling with custom UI and grid layout system</li><li> <strong>DataStar</strong>  lightweight, reactive components directly in Twig templates</li><li> <strong>Vue 3</strong>  used for Web Components and dynamic views powered by GraphQL</li><li> <strong>GraphQL</strong>  native Craft API for structured, frontend-ready data</li><li> <strong>Anime.js</strong>  smooth card and scroll animations with minimal JS</li><li> <strong>Image Component</strong>  Na