creative flexibility while maintaining a clean, controlled data model.</p><p>Each component  such as images, quotes, buttons, or call-to-actions  can be added inline within the text and rendered through the same Twig components used in the Matrix Builder. This allows editors to create visually rich pages directly inside the editor while developers retain full control over markup, consistency, and performance.</p><p>Perfect for content teams who prefer writing in a familiar WYSIWYG interface but still want the power of reusable, design-consistent components.</p><craft-entry data-entry-id=\\\"491\\\"></craft-entry><craft-entry data-entry-id=\\\"492\\\"></craft-entry><craft-entry data-entry-id=\\\"493\\\"></craft-entry><craft-entry data-entry-id=\\\"494\\\"></craft-entry><craft-entry data-entry-id=\\\"495\\\"></craft-entry><craft-entry data-entry-id=\\\"496\\\"></craft-entry><craft-entry data-entry-id=\\\"497\\\"></craft-entry>\"}',1,'2025-10-08 07:58:21','2025-10-08 07:58:21','0b12bb64-da2a-426e-8bf0-d57ac390e7e1'),(663,663,1,NULL,NULL,NULL,'{\"9bd2388d-d293-4f1b-8283-61a80c29e4ac\": \"CKEditor Builder  Structured Components Inside Craft CMS Rich Text\", \"f9112d3e-b4f8-4c57-bbba-1c369f98698d\": \"Insert dynamic components directly inside CKEditor. See how structured content and freeform text can coexist elegantly within Craft CMS.\", \"fb364fbf-e22b-4dbe-8570-724df7c5e068\": [487]}',1,'2025-10-08 07:58:21','2025-10-08 07:58:21','f174160d-9996-4a4a-9651-e4826c9a8bb6'),(666,666,1,'Matrix Builder','matrix-builder','matrix-builder','{\"872f39e9-c6e7-4db6-9915-33944177d829\": \" Matrix Builder\"}',1,'2025-10-08 07:58:27','2025-10-08 07:58:27','49b49d78-7fc9-47de-857b-029b5e9fb0c2'),(667,667,1,NULL,NULL,NULL,'{\"9bd2388d-d293-4f1b-8283-61a80c29e4ac\": \"Matrix Builder  Modular Content Blocks for Craft CMS\", \"f9112d3e-b4f8-4c57-bbba-1c369f98698d\": \"Explore how flexible content creation works in Craft CMS using Matrix fields. Each component is reusable, responsive, and fits seamlessly into the custom Grid Layout system.\", \"fb364fbf-e22b-4dbe-8570-724df7c5e068\": [470]}',1,'2025-10-08 07:58:27','2025-10-08 07:58:27','1f24fdc8-a9f5-4572-bd7a-991a133d9e85'),(670,670,1,'Blog (Datastar)','blog-datastar','blog-datastar','{\"b999da82-f3cc-42df-bf8b-7302ef816953\": \"<p class=\\\"ui-teaser\\\">The DataStar-powered Blog showcases how you can build <strong>dynamic, reactive interfaces in Craft CMS  without any JavaScript frameworks</strong>. Using the DataStar plugin, the blog demonstrates features like <strong>category filtering</strong>, <strong>infinite load-more pagination</strong>, and <strong>real-time UI updates</strong>, all written directly in Twig.</p><p>Theres no need for Vue, React, or Alpine  DataStar takes care of the reactivity by leveraging HTML attributes and a lightweight JavaScript layer. This makes it ideal for developers who want <strong>snappy, interactive experiences</strong> while keeping Craft templates fully server-rendered and easy to maintain.</p><p>Each filter or button click triggers an AJAX patch request that replaces or appends elements using Twig partials  preserving accessibility and SEO. The setup is minimal, performant, and perfectly suited for blogs, listings, or search components inside Craft CMS projects.</p><p>In short: <strong>a modern, Alpine-style experience  built purely in Twig</strong>.</p>\", \"c67defbb-160e-48ab-9dc8-7a4dc6e8db58\": \" Blog (Datastar)\"}',1,'2025-10-08 07:58:51','2025-10-08 07:58:51','649309c2-8798-4995-ad88-2ab5564b9368'),(671,671,1,NULL,NULL,NULL,'{\"9bd2388d-d293-4f1b-8283-61a80c29e4ac\": \"Blog Demo  Datastar Filter & Load More in Craft CMS\", \"f9112d3e-b4f8-4c57-bbba-1c369f98698d\": \"A fully dynamic blog built with Datastar for instant filtering and pagination. No reloading, just smooth updates and fast performance  powered by Craft CMS.\"}',1,'2025-10-08 07:58:51','2025-10-08 07:58:51','5f63b215-801a-40e6-a3da-466325d102ab'),(674,674,1,'Blog (Vue)','blog-vue','blog-vue','{\"d5e6d8c8-d270-4cb5-9e6f-84c64de0bafa\": \"<p class=\\\"ui-teaser\\\">The Vue-powered Blog demonstrates how you can build <strong>fully reactive and API-driven content experiences</strong> in Craft CMS using <strong>Vue 3 as a Web Component</strong>.</p><p>Instead of relying on Twig and DataStar, this version fetches all entries and categories dynamically via the <strong>Craft CMS GraphQL API</strong>  no Craft plugins required. It features <strong>category filtering</strong>, <strong>lazy loading</strong>, and <strong>load more pagination</strong>, all handled client-side with reactive state management. Editors still manage content in Crafts control panel, while the front end consumes it as structured GraphQL data  making it ideal for <strong>hybrid projects</strong> that blend Crafts authoring comfort with modern JavaScript flexibility.</p><p>This approach provides a great example of how <strong>Vue can be used progressively inside Craft</strong>, without needing a separate frontend build or headless setup. Everything compiles into a <strong>single lightweight custom element</strong>, ready to drop into any Twig template.</p>\", \"f8fa90ba-e624-4c6b-82e5-806c7c869935\": \" Blog (Vue)\"}',1,'2025-10-08 07:59:09','2025-10-08 07:59:09','2f4dcac3-747d-424f-bfed-8f1a35684ef1'),(675,675,1,NULL,NULL,NULL,'{\"9bd2388d-d293-4f1b-8283-61a80c29e4ac\": \"Blog Demo  Vue Web Component + GraphQL in Craft CMS\", \"f9112d3e-b4f8-4c57-bbba-1c369f98698d\": \"A modern blog demo using Vue 3, GraphQL, and Vite. Includes live filtering, pagination, and reusable web components built directly into Craft CMS.\"}',1,'2025-10-08 07:59:09','2025-10-08 07:59:09','611c966e-c1a3-4b04-930b-8db595a97391'),(678,678,1,'Richtext','richtext','richtext','{\"07a9b258-5c86-435c-bd6b-ca038ff4e5e9\": \"<h1><strong>This is a headline h1</strong></h1><p class=\\\"ui-teaser\\\"><strong>This is teasertext .. nullam id dolor id nibh ultricies vehicula ut id elit. Integer posuere erat a ante venenatis dapi