388d-d293-4f1b-8283-61a80c29e4ac\": \"Rich Text Demo  Headings, Lists, Links & Styled Content in Craft CMS\", \"f9112d3e-b4f8-4c57-bbba-1c369f98698d\": \"Showcasing rich text styling inside Craft CMS. Includes headings, paragraphs, lists, and links  all styled with Tailwind and optimized for readability.\"}',1,'2025-10-08 07:59:26','2025-10-08 07:59:26','d95298df-eed7-400c-9f0c-e06d9c990a6c'),(682,682,1,'Home','home','__home__','{\"872f39e9-c6e7-4db6-9915-33944177d829\": \"CraftCMS Lazy \\nA simple Craft CMS Starter Kit\"}',1,'2025-10-08 08:04:18','2025-10-08 08:04:18','87c4317f-1575-48c2-aa38-a6e3b2529b67'),(683,683,1,NULL,NULL,NULL,'{\"9bd2388d-d293-4f1b-8283-61a80c29e4ac\": \"Craft CMS Boilerplate  Modern Starter Kit with Vite, Tailwind & Datastar\", \"f9112d3e-b4f8-4c57-bbba-1c369f98698d\": \"A modern Craft CMS boilerplate featuring Vite, Tailwind CSS, Vue 3, Datastar, and GraphQL. Built for developers and agencies looking for a fast, scalable, and beautifully structured starting point for new Craft projects.\"}',1,'2025-10-08 08:04:18','2025-10-08 08:04:18','960ded9f-8a1f-4d63-aa9f-608df8522cd7'),(686,686,1,'Home','home','__home__','{\"872f39e9-c6e7-4db6-9915-33944177d829\": \"CraftCMS Lazy \\nA simple Craft CMS Starter Kit\"}',1,'2025-10-08 08:49:26','2025-10-08 08:49:26','a65eed45-03b1-40df-a5d1-1b43cf7ba249'),(687,687,1,NULL,'__temp_xmyryjgfvmihfecdlkmvkhurafqliwjajpcz',NULL,'{\"54ea783f-26e8-4a98-a119-9a041012aa68\": \"<p class=\\\"ui-teaser\\\">This starter kit is designed to help developers quickly spin up clean and maintainable Craft CMS projects. It includes ready-made examples for Matrix Blocks, CKEditor integration, and both DataStar- and Vue-powered blog listings.</p><p>This boilerplate is designed to demonstrate a clean, scalable, and modern Craft CMS setup  perfect for agencies, freelancers, and developers who want a strong, production-ready starting point for new Craft CMS projects.</p><h3><strong> Tech Stack</strong></h3><ul><li> <strong>Craft CMS 5</strong>  latest version with sections, Matrix fields &amp; full headless support</li><li> <strong>Vite</strong>  modern asset bundler with instant hot reload and Vue integration</li><li> <strong>DDEV</strong>  Docker-based local dev environment for PHP, MySQL &amp; HTTPS</li><li> <strong>Tailwind CSS</strong>  utility-first styling with custom UI and grid layout system</li><li> <strong>DataStar</strong>  lightweight, reactive components directly in Twig templates</li><li> <strong>Vue 3</strong>  used for Web Components and dynamic views powered by GraphQL</li><li> <strong>GraphQL</strong>  native Craft API for structured, frontend-ready data</li><li> <strong>Anime.js</strong>  smooth card and scroll animations with minimal JS</li><li> <strong>Image Component</strong>  Native Craft transforms with WebP/AVIF support and blur-up LQIP placeholders.</li></ul><h3><strong> Craft CMS Plugins</strong></h3><ul><li> <strong>CKEditor</strong>  flexible rich-text editor with custom inline components</li><li> <strong>DataStar</strong>  reactive live rendering for Twig templates</li><li> <strong>Image Resizer</strong>  automatic image optimization and responsive transforms</li><li> <strong>SEOMate</strong>  SEO metadata, Open Graph, and sitemap integration</li><li> <strong>Vite Plugin</strong>  connects Vite dev server seamlessly with Craft CMS</li></ul>\"}',1,'2025-10-08 08:49:26','2025-10-08 08:49:26','69c343cb-5f16-48d9-9ddf-f51ce3fffbdd'),(690,690,1,'Home','home','__home__','{\"872f39e9-c6e7-4db6-9915-33944177d829\": \"CraftCMS Lazy \\nA simple Craft CMS Starter Kit\"}',1,'2025-10-08 08:54:25','2025-10-08 08:54:25','e6664694-c076-4bfa-a4af-f69a51c8d5c9'),(691,691,1,NULL,'__temp_xmyryjgfvmihfecdlkmvkhurafqliwjajpcz',NULL,'{\"54ea783f-26e8-4a98-a119-9a041012aa68\": \"<p class=\\\"ui-teaser\\\">This starter kit is designed to help developers quickly spin up clean and maintainable Craft CMS projects. It includes ready-made examples for Matrix Blocks, CKEditor integration, and both DataStar- and Vue-powered blog listings.</p><p>This boilerplate is designed to demonstrate a clean, scalable, and modern Craft CMS setup  perfect for agencies, freelancers, and developers who want a strong, production-ready starting point for new Craft CMS projects.</p><h3><strong> Tech Stack</strong></h3><ul><li> <strong>Craft CMS 5</strong>  latest version with sections, Matrix fields &amp; full headless support</li><li> <strong>Vite</strong>  modern asset bundler with instant hot reload and Vue integration</li><li> <strong>DDEV</strong>  Docker-based local dev environment for PHP, MySQL &amp; HTTPS</li><li> <strong>Tailwind CSS</strong>  utility-first styling with custom UI and grid layout system</li><li> <strong>DataStar</strong>  lightweight, reactive components directly in Twig templates</li><li> <strong>Vue 3</strong>  used for Web Components and dynamic views powered by GraphQL</li><li> <strong>GraphQL</strong>  native Craft API for structured, frontend-ready data</li><li> <strong>Anime.js</strong>  smooth card and scroll animations with minimal JS</li><li> <strong>Image Component</strong>  Responsive images via <strong>native Craft transforms</strong> (JPEG/WebP/AVIF) with sizes/srcset, lazy loading, focal point, <strong>ratio-based crops</strong>, <strong>object-fit</strong> control, and optional blur-up LQIP.</li></ul><h3><strong> Craft CMS Plugins</strong></h3><ul><li> <strong>CKEditor</strong>  flexible rich-text editor with custom inline components</li><li> <strong>DataStar</strong>  reactive live rendering for Twig templates</li><li> <strong>Image Resizer</strong>  automatic image optimization and responsive transforms</li><li> <strong>SEOMate</strong>  SEO metadata, Open Graph, and sitemap integration</li><li> <strong>Vite Plugin</strong>  connects Vite dev server seamlessly with Craft CMS</li></ul>\"}',1,'2025-10-08 08:54:25','2025-10-08 08:54:25','f7570de5-00e6-4412-a908-ba2cb76a1fa6'),(694,694,1,'Home','home','__home__','{\"872f39e9-c6e7-4db