 <strong>DataStar</strong>  reactive live rendering for Twig templates</li><li> <strong>Image Resizer</strong>  automatic image optimization and responsive transforms</li><li> <strong>SEOMate</strong>  SEO metadata, Open Graph, and sitemap integration</li><li> <strong>Vite Plugin</strong>  connects Vite dev server seamlessly with Craft CMS</li></ul>\"}',1,'2025-10-08 08:57:44','2025-10-08 08:57:44','cc5d29ab-8a5c-48c7-b89f-4dfafc03b6b2'),(698,698,1,'Home','home','__home__','{\"872f39e9-c6e7-4db6-9915-33944177d829\": \"CraftCMS Lazy \\nA simple Craft CMS Starter Kit\"}',1,'2025-10-08 09:03:32','2025-10-08 09:03:32','6b5844dc-4d14-44d1-8186-be36688353b1'),(699,699,1,NULL,'__temp_xmyryjgfvmihfecdlkmvkhurafqliwjajpcz',NULL,'{\"54ea783f-26e8-4a98-a119-9a041012aa68\": \"<p class=\\\"ui-teaser\\\">This starter kit is designed to help developers quickly spin up clean and maintainable Craft CMS projects. It includes ready-made examples for Matrix Blocks, CKEditor integration, and both DataStar- and Vue-powered blog listings.</p><p>This boilerplate is designed to demonstrate a clean, scalable, and modern Craft CMS setup  perfect for agencies, freelancers, and developers who want a strong, production-ready starting point for new Craft CMS projects.</p><p><strong> Built with modern tools and clean architecture</strong></p><ul><li> <strong>Craft CMS 5</strong>  latest version with flexible content modeling</li><li> <strong>Vite</strong>  fast bundling and instant reloads</li><li> <strong>DDEV</strong>  reproducible local development environment</li><li> <strong>Datastar</strong>  lightweight, reactive frontend for dynamic UIs</li><li> <strong>Vue 3 (Web Components)</strong>  progressive enhancement with custom elements</li><li> <strong>GraphQL</strong>  structured data fetching directly from Craft</li><li> <strong>Tailwind CSS v4</strong>  utility-first styling with CSS variables</li><li> <strong>Anime.js</strong>  smooth element animations and scroll-based transitions</li><li> 