aa68\": \"<p class=\\\"ui-teaser\\\">A modern, production-ready Craft CMS Starter Kit with Vite, Tailwind, Vue Web Components, Datastar, GraphQL and DDEV  perfect for agencies and freelancers who want to build clean and fast Craft sites..</p><p>This starter kit helps developers quickly spin up clean and maintainable Craft CMS projects. It includes ready-made examples for Matrix Blocks, CKEditor integration, a Datastar-powered Search page, and both Datastar- and Vue-based blog listings.</p><p><strong> Built with modern tools and clean architecture</strong></p><ul><li> <strong>Craft CMS 5</strong>  latest version with flexible content modeling</li><li> <strong>Vite</strong>  fast bundling and instant reloads</li><li> <strong>DDEV</strong>  reproducible local development environment</li><li> <strong>Datastar</strong>  lightweight, reactive frontend for dynamic UIs</li><li> <strong>Vue 3 (Web Components)</strong>  progressive enhancement with custom elements</li><li> <strong>GraphQL</strong>  structured data fetching directly from Craft</li><li> <strong>Tailwind CSS v4</strong>  utility-first styling with CSS variables</li><li> <strong>Anime.js</strong>  smooth element animations and scroll-based transitions</li><li> <strong>Craft eagerly() + render()</strong>  optimized queries, automatic block templates, and smart caching</li><li> <strong>Plugins:</strong> CKEditor, Datastar, Image Resizer, SEOMate, Vite</li></ul><p> Feel free to explore, fork, or contribute  this starter kit is open source and available on GitHub.</p>\"}',1,'2025-10-09 12:46:02','2025-10-09 12:46:02','57660b49-fe47-4f88-90d7-e5be180b2a96'),(752,752,1,NULL,'__temp_xkxefblkbqrrpgdsmxpjqahpwwtxucyulfla',NULL,'{\"0f59f188-6699-4347-a393-7cc6ddd680fc\": false}',1,'2025-10-09 12:46:02','2025-10-09 12:46:02','df175c3a-bedc-440a-907f-a2490f6346b9'),(753,753,1,NULL,'__temp_ymqpcozflkswyiztejqhscgrwkbbvylnvwoy',NULL,'{\"4ca0b060-ab25-4210-ba7a-04339db07b5d\": \" Matrix Builder\", \"b68b894d-8c8e-4fc8-af1c-45b45dfc82d5\": {\"type\": \"entry\", \"label\": \"Read more\", \"value\": \"{entry:12@1:url}\"}, \"e3da269c-60c2-4d60-9a98-718ef293562c\": \"<p>Build flexible page layouts using Crafts Matrix field. Each component can be placed freely within the custom Grid Layout system.</p>\"}',1,'2025-10-09 12:46:02','2025-10-09 12:46:02','9506760c-2c26-4e71-80cd-579b3e57fcc6'),(754,754,1,NULL,'__temp_rookcbakctclekveurvtcgllabmfytnayywb',NULL,'{\"4ca0b060-ab25-4210-ba7a-04339db07b5d\": \" CKEditor Builder\", \"b68b894d-8c8e-4fc8-af1c-45b45dfc82d5\": {\"type\": \"entry\", \"label\": \"Read more\", \"value\": \"{entry:99@1:url}\"}, \"e3da269c-60c2-4d60-9a98-718ef293562c\": \"<p>Insert predefined components directly into CKEditor. A simple example of combining structured elements and rich text content.</p>\"}',1,'2025-10-09 12:46:02','2025-10-09 12:46:02','b3ea46d6-de27-4faf-853d-f3ee1e074121'),(755,755,1,NULL,'__temp_exydctshdtrxmqnzznfpmdmwtnijllasnzlm',NULL,'{\"4ca0b060-ab25-4210-ba7a-04339db07b5d\": \" Datastar Search\", \"b68b894d-8c8e-4fc8-af1c-45b45dfc82d5\": {\"type\": \"entry\", \"label\": \"Read more\", \"value\": \"{entry:723@1:url}\"}, \"e3da269c-60c2-4d60-9a98-718ef293562c\": \"<p>Fast and lightweight search using Craft Datastar. Instant results, live updates, and minimal JavaScript.</p>\"}',1,'2025-10-09 12:46:02','2025-10-09 12:46:02','94ac525c-1107-4878-8775-d6527a8c5517'),(756,756,1,NULL,'__temp_wivzvacapfdmeujajaupvewukwdvqvhisguk',NULL,'{\"4ca0b060-ab25-4210-ba7a-04339db07b5d\": \" Blog (Datastar)\", \"b68b894d-8c8e-4fc8-af1c-45b45dfc82d5\": {\"type\": \"entry\", \"label\": \"Read more\", \"value\": \"{entry:258@1:url}\"}, \"e3da269c-60c2-4d60-9a98-718ef293562c\": \"<p>A dynamic blog built with Craft DataStar. Features live filtering, pagination, and instant content updates without page reloads.</p>\"}',1,'2025-10-09 12:46:02','2025-10-09 12:46:02','6832608a-6cb0-4ac4-bc2b-e6cb5b423d2f'),(757,757,1,NULL,'__temp_lwnertfphvvauwgyrfvklnfsixfpapkltjzf',NULL,'{\"4ca0b060-ab25-4210-ba7a-04339db07b5d\": \" Blog (Vue)\", \"b68b894d-8c8e-4fc8-af1c-45b45dfc82d5\": {\"type\": \"entry\", \"label\": \"Read more\", \"value\": \"{entry:359@1:url}\"}, \"e3da269c-60c2-4d60-9a98-718ef293562c\": \"<p>A Vue-based blog using GraphQL. Demonstrates reactive filtering, load more functionality, and category management via API.</p>\"}',1,'2025-10-09 12:46:02','2025-10-09 12:46:02','e46d04b6-7372-4cbe-936e-7a1b339cabf7'),(758,758,1,NULL,'__temp_uvnzbtbsulagvvlmhwivhpmohuohwpnvjcon',NULL,'{\"4ca0b060-ab25-4210-ba7a-04339db07b5d\": \" Grid Layout\", \"b68b894d-8c8e-4fc8-af1c-45b45dfc82d5\": {\"type\": \"url\", \"label\": \"Layout\", \"value\": \"/layout\"}, \"e3da269c-60c2-4d60-9a98-718ef293562c\": \"<p>Shows the responsive Grid Layout system used across all pages. Easily define full, content, feature, or popout columns.</p>\"}',1,'2025-10-09 12:46:02','2025-10-09 12:46:02','235ec66f-4603-4a24-92e2-ce5790a32b8c'),(759,759,1,NULL,'__temp_qidilehdbzvpsmfjihkjiogbgamgjxlbldmq',NULL,'{\"54ea783f-26e8-4a98-a119-9a041012aa68\": \"<p><strong>About this project</strong></p><p>Im <strong>Andi Grether</strong>, a freelance full-stack developer specialized in <strong>Craft CMS</strong>. This starter kit reflects how I build modern Craft projects  clean, modular, and ready for real-world use. I work with creative agencies and design teams who need a reliable technical partner to bring their ideas to life. If you like this setup and want to collaborate, feel free to get in touch. Visit <a href=\\\"https://webworker.me\\\"><strong>webworker.me</strong></a></p>\"}',1,'2025-10-09 12:46:02','2025-10-09 12:46:02','afc8fb54-559a-485e-9284-055567a4fef2'),(760,760,1,'Home','home','__home__','{\"872f39e9-c6e7-4db6-9915-33944177d829\": \"CraftCMS Lazy \\nA simple Craft CMS Starter Kit\"}',1,'2025-10-09 12:52:15','2025-10-09 12:52:15','1015ead8-266d-4ece-a794-1833109fc769'),(762,762,1,'Blog (Datastar)','blog-datastar','blog-datastar','{\"b999da82-f3cc-42df-bf8b-7302ef816953\": \"<p class=\\\"ui-teaser\\\">The Datastar-powered Blog showcases how you can build <strong>dynamic, reactive interfaces in Craft CMS  without any JavaScript frameworks</strong>. Using the DataStar plugin, the blog demonstrates features like <strong>category filtering</strong>, <strong>infinite load-more pagination</strong>, and <strong>real-time UI updates</strong>, all written directly in Twig.</p><p>Theres no need for Vue, React, or Alpine  DataStar takes care of the reactivity by leveraging HTML attributes and a lightweight JavaScript layer. This makes it ideal for developers who want <strong>snappy, interactive experiences</strong> while keeping Craft templates fully server-rendered and easy to maintain.</p><p>Each filter or button click triggers an AJAX patch request that replaces or appends elements using Twig partials  preserving accessibility and SEO. The setup is minimal, performant, and perfectly suited for blogs, listings, or search components inside Craft CMS projects.</p><p>In short: <strong>a modern, Alpine-style experience  built purely in Twig</strong>.</p>\", \"c67defbb-160e-48ab-9dc8-7a4dc6e8db58\": \" Blog (Datastar)\"}',1,'2025-10-09 12:56:39','2025-10-09 12:56:39','816b054c-1fc1-47e9-891b-40f9f9c23a47'),(763,763,1,NULL,NULL,NULL,'{\"9bd2388d-d293-4f1b-8283-61a80c29e4ac\": \"Blog Demo  Datastar Filter & Load More in Craft CMS\", \"f9112d3e-b4f8-4c57-bbba-1c369f98698d\": \"A fully dynamic blog built with Datastar for instant filtering and pagination. No reloading, just smooth updates and fast performance  powered by Craft CMS.\"}',1,'2025-10-09 12:56:39','2025-10-09 12:56:39','e0f60ab3-7b83-4a35-979d-0c8549218488'),(765,765,1,'Blog (Datastar)','blog-datastar','blog-datastar','{\"b999da82-f3cc-42df-bf8b-7302ef816953\": \"<p class=\\\"ui-teaser\\\">The Datastar-powered Blog showcases how you can build <strong>dynamic, reactive interfaces in Craft CMS  without any JavaScript frameworks</strong>. Using the Datastar plugin, the blog demonstrates features like <strong>category filtering</strong>, <strong>infinite load-more pagination</strong>, and <strong>real-time UI updates</strong>, all written directly in Twig.</p><p>Theres no need for Vue, React, or Alpine  DataStar takes care of the reactivity by leveraging HTML attributes and a lightweight JavaScript layer. This makes it ideal for developers who want <strong>snappy, interactive experiences</strong> while keeping Craft templates fully server-rendered and easy to maintain.</p><p>Each filter or button click triggers an AJAX patch request that replaces or appends elements using Twig partials  preserving accessibility and SEO. The setup is minimal, performant, and perfectly suited for blogs, listings, or search components inside Craft CMS projects.</p><p>In short: <strong>a modern, Alpine-style experience  built purely in Twig</strong>.</p>\", \"c67defbb-160e-48ab-9dc8-7a4dc6e8db58\": \" Blog (Datastar)\"}',1,'2025-10-09 12:56:41','2025-10-09 12:56:41','e7951057-a0e0-4b7c-963e-4a80a05a1018'),(766,766,1,'Mollis Bibendum Lorem Amet','mollis-bibendum-lorem-amet','blog/mollis-bibendum-lorem-amet','{\"6268711e-041f-4ba2-ac1f-69075f35f133\": {\"date\": \"2025-04-14 22:00:00\"}, \"6ebd48e4-16ae-438b-88db-b7c32dac5dbd\": [266], \"7f45d57a-6089-4476-9875-732dfa47a1a0\": {\"id\": null, \"lat\": 52.5173885, \"lng\": 13.3951309, \"zoom\": 15, \"parts\": {\"arm\": \"Orion Arm\", \"city\": \"Berlin\", \"group\": \"the Local Group\", \"state\": \"\", \"county\": \"\", \"galaxy\": \"Milky Way\", \"number\": \"\", \"planet\": \"Earth\", \"system\": \"the Solar System\", \"address\": \"\", \"cluster\": \"Virgo Cluster\", \"country\": \"Germany\", \"postcode\": \"\", \"supercluster\": \"Laniakea Supercluster\"}, \"address\": \"Berlin, Germany\", \"fieldId\": 34, \"ownerId\": 766, \"distance\": null, \"what3words\": null, \"ownerSiteId\": 1}, \"96a98d05-9c97-4424-b5b3-b60a09dafe54\": {\"type\": \"url\", \"value\": \"https://webworker.me/\"}, \"f333c3f6-b95e-4720-8b85-bac84b0fd6bf\":