/p><p>Theres no need for Vue, React, or Alpine  DataStar takes care of the reactivity by leveraging HTML attributes and a lightweight JavaScript layer. This makes it ideal for developers who want <strong>snappy, interactive experiences</strong> while keeping Craft templates fully server-rendered and easy to maintain.</p><p>Each filter or button click triggers an AJAX patch request that replaces or appends elements using Twig partials  preserving accessibility and SEO. The setup is minimal, performant, and perfectly suited for blogs, listings, or search components inside Craft CMS projects.</p><p>In short: <strong>a modern, Alpine-style experience  built purely in Twig</strong>.</p>\", \"c67defbb-160e-48ab-9dc8-7a4dc6e8db58\": \" Blog (Datastar)\"}',1,'2025-10-09 14:04:42','2025-10-09 14:04:42','5e9c8d4e-a917-4e98-9623-cec4e1126b6b'),(773,773,1,'Home','home','__home__','{\"872f39e9-c6e7-4db6-9915-33944177d829\": \"CraftCMS Lazy \\nA simple Craft CMS Starter Kit\"}',1,'2025-10-10 08:15:09','2025-10-10 08:15:09','2335f573-eb8d-4760-b8e9-81b06b2854a7'),(774,774,1,NULL,'__temp_xkxefblkbqrrpgdsmxpjqahpwwtxucyulfla',NULL,'{\"0f59f188-6699-4347-a393-7cc6ddd680fc\": false}',1,'2025-10-10 08:15:09','2025-10-10 08:15:09','517fdcbf-e17b-40af-b55d-8914f1ed9825'),(775,775,1,NULL,'__temp_ymqpcozflkswyiztejqhscgrwkbbvylnvwoy',NULL,'{\"4ca0b060-ab25-4210-ba7a-04339db07b5d\": \" Matrix Builder\", \"b68b894d-8c8e-4fc8-af1c-45b45dfc82d5\": {\"type\": \"entry\", \"value\": \"{entry:12@1:url}\"}, \"e3da269c-60c2-4d60-9a98-718ef293562c\": \"<p>Build flexible page layouts using Crafts Matrix field. Each component can be placed freely within the custom Grid Layout system.</p>\"}',1,'2025-10-10 08:15:09','2025-10-10 08:15:09','2285830f-5840-4678-9fca-14b599bc4800'),(779,779,1,'Home','home','__home__','{\"872f39e9-c6e7-4db6-9915-33944177d829\": \"CraftCMS Lazy \\nA simple Craft CMS Starter Kit\"}',1,'2025-10-10 08:48:34','2025-10-10 08:48:34','cb81bf31-0d02-4bf4-b37e-6c1dec5f2828'),(780,780,1