-builder','{\"872f39e9-c6e7-4db6-9915-33944177d829\": \" Matrix Builder\"}',1,'2025-10-10 08:56:11','2025-10-10 08:56:11','a952b18a-ba13-4373-a1e5-a1c73e4b18d5'),(792,792,1,NULL,NULL,NULL,'{\"9bd2388d-d293-4f1b-8283-61a80c29e4ac\": \"Matrix Builder  Modular Content Blocks for Craft CMS\", \"f9112d3e-b4f8-4c57-bbba-1c369f98698d\": \"Explore how flexible content creation works in Craft CMS using Matrix fields. Each component is reusable, responsive, and fits seamlessly into the custom Grid Layout system.\", \"fb364fbf-e22b-4dbe-8570-724df7c5e068\": [470]}',1,'2025-10-10 08:56:11','2025-10-10 08:56:11','7c6cf188-42b6-4974-a0c4-9418fa29c422'),(793,793,1,NULL,'__temp_igexmbvajwvcuuzsdrygzfnvhrvrckpdgpyk',NULL,'{\"54ea783f-26e8-4a98-a119-9a041012aa68\": \"<p class=\\\"ui-teaser\\\">The <strong>Matrix Builder</strong> is a visual demonstration of how Craft CMS handles flexible, component-based content through Matrix fields.</p><p>It shows how editors can create rich page layouts by combining different blocks  such as text, images, quotes, buttons, or call-to-action elements  without writing any code. Each block is powered by a reusable Twig component with consistent markup and a shared design system, making it easy for developers to maintain, extend, and customize.</p><p>What makes this setup especially powerful is that <strong>every component can be placed anywhere within the custom </strong><a href=\\\"/layout\\\"><strong>CSS Grid layout</strong></a>, using named grid areas like content, popout, feature, or full. This gives editors complete control over structure and visual hierarchy while developers retain full semantic and performance control.</p>\"}',1,'2025-10-10 08:56:11','2025-10-10 08:56:11','618c0d04-9dd8-427f-8e98-1ecbb1e278f4'),(794,794,1,NULL,'__temp_dkucgpvpbmgwouxblhhoezbgricogtigdgeh',NULL,'{\"26b82635-94fe-4602-bc9b-85d9440f803d\": false, \"293325f0-efb5-4532-bed8-8ece59244dd0\": [470]}',1,'2025-10-10 08:56:11','2025-10-10 08:56:11','6c48f3b1-06f2-41bc-933