:39','2025-11-04 12:43:39','a8a86940-ec24-40d1-b4a6-bc19d0425965'),(912,912,1,NULL,'__temp_xmyryjgfvmihfecdlkmvkhurafqliwjajpcz',NULL,'{\"54ea783f-26e8-4a98-a119-9a041012aa68\": \"<p class=\\\"ui-teaser\\\">A modern, production-ready Craft CMS Starter Kit with Vite, Tailwind, Vue Web Components, Datastar, GraphQL and DDEV  perfect for agencies and freelancers who want to build clean and fast Craft sites..</p><p>This starter kit helps developers quickly spin up clean and maintainable Craft CMS projects. It includes ready-made examples for Matrix Blocks, CKEditor integration, a Datastar-powered Search page, and both Datastar- and Vue-based blog listings.</p><p><strong> Built with modern tools and clean architecture</strong></p><ul><li> <strong>Craft CMS 5</strong>  latest version with flexible content modeling</li><li> <strong>Vite</strong>  fast bundling and instant reloads</li><li> <strong>DDEV</strong>  reproducible local development environment</li><li> <strong>Datastar</strong>  lightweight, reactive frontend for dynamic UIs</li><li> <strong>Vue 3 (Web Components)</strong>  progressive enhancement with custom elements</li><li> <strong>GraphQL</strong>  structured data fetching directly from Craft</li><li> <strong>Tailwind CSS v4</strong>  utility-first styling with CSS variables</li><li> <strong>Anime.js</strong>  smooth element animations and scroll-based transitions</li><li> <strong>Craft eagerly() + render()</strong>  optimized queries, automatic block templates, and smart caching</li><li><strong> SEO-Ready JSON-LD Organization Schema </strong> structured data for Google Rich Results</li><li> <strong>Automatic Sitemap.xml, Open Graph &amp; Meta Tags</strong>  powered by SEOMate for share-friendly pages</li><li> <strong>Plugins:</strong> CKEditor, Datastar, Image Resizer, SEOMate, Vite</li></ul><p> Feel free to explore, fork, or contribute  this starter kit is open source and available on GitHub.</p>\"}',1,'2025-11-04 12:43:39','2025-11-04 12:43:39','4a415976-e76c-4f7a-b72f-63862779a017'),(915,915,1,'Home','home','__home__','{\"872f39e9-c6e7-4db6-9915-33944177d829\": \"CraftCMS Lazy \\nA simple Craft CMS Starter Kit\"}',1,'2025-11-04 12:45:15','2025-11-04 12:45:15','6d3abcc6-8850-417d-81ff-a88b51347bd5'),(916,916,1,NULL,'__temp_xmyryjgfvmihfecdlkmvkhurafqliwjajpcz',NULL,'{\"54ea783f-26e8-4a98-a119-9a041012aa68\": \"<p class=\\\"ui-teaser\\\">A modern, production-ready Craft CMS Starter Kit with Vite, Tailwind, Vue Web Components, Datastar, GraphQL and DDEV  perfect for agencies and freelancers who want to build clean and fast Craft sites..</p><p>This starter kit helps developers quickly spin up clean and maintainable Craft CMS projects. It includes ready-made examples for Matrix Blocks, CKEditor integration, a Datastar-powered Search page, and both Datastar- and Vue-based blog listings.</p><p><strong> Built with modern tools and clean architecture</strong></p><ul><li> <strong>Craft CMS 5</strong>  latest version with flexible content modeling</li><li> <strong>Vite</strong>  fast bundling and instant reloads</li><li> <strong>DDEV</strong>  reproducible local development environment</li><li> <strong>Datastar</strong>  lightweight, reactive frontend for dynamic UIs</li><li> <strong>Vue 3 (Web Components)</strong>  progressive enhancement with custom elements</li><li> <strong>GraphQL</strong>  structured data fetching directly from Craft</li><li> <strong>Tailwind CSS v4</strong>  utility-first styling with CSS variables</li><li> <strong>Anime.js</strong>  smooth element animations and scroll-based transitions</li><li> <strong>Craft eagerly() + render()</strong>  optimized queries, automatic block templates, and smart caching</li><li><strong> SEO-Ready JSON-LD Organization Schema </strong> structured data for Google Rich Results</li><li> <strong>SEO Meta, Open Graph &amp; Sitemap </strong> powered by SEOMate for share-friendly pages</li><li> <strong>Plugins:</strong> CKEditor, Datastar, Image Resizer, SEOMate, Vite</li></ul><p> Feel free to explore, fork, or contribute  this starter kit is open source and available on GitHub.</p>\"}',1,'2025-11-04 12:45:15','2025-11-04 12:45:15','0326be20-e150-4033-af1c-63b22f389f11'),(917,917,1,'Map','map','map','{\"2b51574c-5057-4c70-9a63-3e3612eb11b0\": \"<h1><strong> Datastar + Leaflet Demo</strong></h1><p>The <strong>Datastar-powered Map</strong> shows how you can build <strong>interactive, data-driven maps</strong> in <strong>Craft CMS</strong>  without relying on any JavaScript framework. Using <strong>Datastar</strong>, the map dynamically updates <strong>markers, filters, and clusters</strong> based on live CMS data  all rendered directly in <strong>Twig</strong>.</p><p> <strong>Reactive without React</strong></p><p>Every interaction  like filtering by category or selecting an item from the list  triggers a lightweight Datastar patch request that updates only whats needed. No reloads, no heavy frontend stack  just instant feedback.</p><h3> <strong>Powered by Leaflet.js</strong></h3><p>Leaflet handles map rendering while Datastar manages reactivity. The result is a setup that stays <strong>fast, accessible, and fully server-rendered</strong>.</p><h3> <strong>Perfect for:</strong></h3><p>directories  location listings  event maps  or any project using dynamic geodata  all without leaving the comfort of Craft + Twig.</p><p> <i>In short: a modern, dynamic map experience  built purely with Craft CMS, Leaflet, and Datastar.</i></p>\"}',1,'2025-11-07 09:25:16','2025-11-07 11:39:38','0253805c-b604-426f-a1a6-a25f78254dba'),(918,918,1,'Map','map','map',NULL,1,'2025-11-07 09:25:16','2025-11-07 09:25:16','0a616247-ea3b-4549-85fb-8860e531f2b9'),(919,919,1,NULL,NULL,NULL,'{\"9bd2388d-d293-4f1b-8283-61a80c29e4ac\": \"Interactive Maps in Craft CMS with Datastar & Leaflet\", \"f9112d3e-b4f8-4c57-bbba-1c369f98698d\": \"A live demo of an interactive Leaflet map powered by Craft CMS and Datastar. Dynamic markers, filters, and clustering  all from real CMS data.\", 