025-11-07 11:35:27','2fbcd524-8996-4394-ac14-8de080ff2bb7'),(980,980,1,NULL,NULL,NULL,'{\"9bd2388d-d293-4f1b-8283-61a80c29e4ac\": \"Interactive Maps in Craft CMS with Datastar & Leaflet\", \"f9112d3e-b4f8-4c57-bbba-1c369f98698d\": \"A live demo of an interactive Leaflet map powered by Craft CMS and Datastar. Dynamic markers, filters, and clustering  all from real CMS data.\"}',1,'2025-11-07 11:35:27','2025-11-07 11:35:27','b4b80e34-9e22-4e36-a995-8adb98669ea7'),(982,982,1,'Map','map','map','{\"2b51574c-5057-4c70-9a63-3e3612eb11b0\": \"<h2><strong> Datastar + Leaflet Demo</strong></h2><p>The <strong>Datastar-powered Map</strong> shows how you can build <strong>interactive, data-driven maps</strong> in <strong>Craft CMS</strong>  without relying on any JavaScript framework. Using <strong>Datastar</strong>, the map dynamically updates <strong>markers, filters, and clusters</strong> based on live CMS data  all rendered directly in <strong>Twig</strong>.</p><p> <strong>Reactive without React</strong></p><p>Every interaction  like filtering by category or selecting an item from the list  triggers a lightweight Datastar patch request that updates only whats needed. No reloads, no heavy frontend stack  just instant feedback.</p><h2> <strong>Powered by Leaflet.js</strong></h2><p>Leaflet handles map rendering while Datastar manages reactivity. The result is a setup that stays <strong>fast, accessible, and fully server-rendered</strong>.</p><h2> <strong>Perfect for:</strong></h2><p>directories  location listings  event maps  or any project using dynamic geodata  all without leaving the comfort of Craft + Twig.</p><p> <i>In short: a modern, dynamic map experience  built purely with Craft CMS, Leaflet, and Datastar.</i></p>\"}',1,'2025-11-07 11:38:15','2025-11-07 11:38:15','686d4838-78c3-4585-b38a-6499ee04ad30'),(984,984,1,'Map','map','map','{\"2b51574c-5057-4c70-9a63-3e3612eb11b0\": \"<h3><strong> Datastar + Leaflet Demo</strong></h3><p>The <strong>Datastar-powered Map</strong> shows how you can build <strong>interactive, data-driven maps</strong> in <strong>Craft CMS</strong>  without relying on any JavaScript framework. Using <strong>Datastar</strong>, the map dynamically updates <strong>markers, filters, and clusters</strong> based on live CMS data  all rendered directly in <strong>Twig</strong>.</p><p> <strong>Reactive without React</strong></p><p>Every interaction  like filtering by category or selecting an item from the list  triggers a lightweight Datastar patch request that updates only whats needed. No reloads, no heavy frontend stack  just instant feedback.</p><h3> <strong>Powered by Leaflet.js</strong></h3><p>Leaflet handles map rendering while Datastar manages reactivity. The result is a setup that stays <strong>fast, accessible, and fully server-rendered</strong>.</p><h3> <strong>Perfect for:</strong></h3><p>directories  location listings  event maps  or any project using dynamic geodata  all without leaving the comfort of Craft + Twig.</p><p> <i>In short: a modern, dynamic map experience  built purely with Craft CMS, Leaflet, and Datastar.</i></p>\"}',1,'2025-11-07 11:39:11','2025-11-07 11:39:11','80af7a28-dd33-401e-9976-230cd01b4772'),(986,986,1,'Map','map','map','{\"2b51574c-5057-4c70-9a63-3e3612eb11b0\": \"<h1><strong> Datastar + Leaflet Demo</strong></h1><p>The <strong>Datastar-powered Map</strong> shows how you can build <strong>interactive, data-driven maps</strong> in <strong>Craft CMS</strong>  without relying on any JavaScript framework. Using <strong>Datastar</strong>, the map dynamically updates <strong>markers, filters, and clusters</strong> based on live CMS data  all rendered directly in <strong>Twig</strong>.</p><p> <strong>Reactive without React</strong></p><p>Every interaction  like filtering by category or selecting an item from the list  triggers a lightweight Datastar patch request that updates only whats needed. No reloads, no heavy frontend stack  just instant feedback.</p><h3> <strong>Powered by Leaflet.js</strong></h3><p>Leaflet handles map rendering while Datastar manages reactivity. The result is a setup that stays <strong>fast, accessible, and fully server-rendered</strong>.</p><h3> <strong>Perfect for:</strong></h3><p>directories  location listings  event maps  or any project using dynamic geodata  all without leaving the comfort of Craft + Twig.</p><p> <i>In short: a modern, dynamic map experience  built purely with Craft CMS, Leaflet, and Datastar.</i></p>\"}',1,'2025-11-07 11:39:38','2025-11-07 11:39:38','6f8c5c2f-8b83-4393-8ad9-c4a761392db5'),(989,989,1,'Home','home','__home__','{\"872f39e9-c6e7-4db6-9915-33944177d829\": \"CraftCMS Lazy \\nA simple Craft CMS Starter Kit\"}',1,'2025-11-07 11:41:43','2025-11-07 11:41:43','5b39bad9-0827-4ee4-8299-770002a8509f'),(990,990,1,NULL,'__temp_xmyryjgfvmihfecdlkmvkhurafqliwjajpcz',NULL,'{\"54ea783f-26e8-4a98-a119-9a041012aa68\": \"<p class=\\\"ui-teaser\\\">A modern, production-ready Craft CMS Starter Kit with Vite, Tailwind, Vue Web Components, Datastar, GraphQL and DDEV  perfect for agencies and freelancers who want to build clean and fast Craft sites..</p><p>This starter kit helps developers quickly spin up clean and maintainable Craft CMS projects. It includes ready-made examples for Matrix Blocks, CKEditor integration, a Datastar-powered Search page, and both Datastar- and Vue-based blog listings.</p><p><strong> Built with modern tools and clean architecture</strong></p><ul><li> <strong>Craft CMS 5</strong>  latest version with flexible content modeling</li><li> <strong>Vite</strong>  fast bundling and instant reloads</li><li> <strong>DDEV</strong>  reproducible local development environment</li><li> <strong>Datastar</strong>  lightweight, reactive frontend for dynamic UIs</li><li> <strong>Vue 3 (Web Components)</strong>  progressive enhancement with custom elements</li><li> <strong>GraphQL</strong>  structured data fetching directly from Craft</li><li> <strong>Tailwind CSS v4</strong>  utility-first styling with CSS variables</li><li> <strong>Anime.js</strong>  smooth element animations and scroll-based transitions</li><li> <strong>Craft eagerly() + render()</strong>  optimized queries, automatic block templates, and smart caching</li><li><strong> SEO-Ready JSON-LD Organization Schema </strong> structured data for Google Rich Results</li><li> <strong>SEO Meta, Open Graph &amp; Sitemap </strong> powered by SEOMate for share-friendly pages</li><li> <strong>Plugins:</strong> CKEditor, Datastar, Map, Image Resizer, SEOMate, Vite</li></ul><p> Feel free to explore, fork, or contribute  this starter kit is open source and available on GitHub.</p>\"}',1,'2025-11-07 11:41:43','2025-11-07 11:41:43','ef230133-a862-44c7-9214-e37790c2ec34'),(994,994,1,'Home','home','__home__','{\"872f39e9-c6e7-4db6-9915-33944177d829\": \"CraftCMS Lazy \\nA simple Craft CMS Starter Kit\"}',1,'2025-11-07 11:43:20','2025-11-07 11:43:20','6ff675be-bf7d-4ce0-a9e3-0772b8b5cdd7'),(995,995,1,NULL,'__temp_xkxefblkbqrrpgdsmxpjqahpwwtxucyulfla',NULL,'{\"0f59f188-6699-4347-a393-7cc6ddd680fc\": false}',1,'2025-11-07 11:43:20','2025-11-07 11:43:20','3ad49a2c-2f0d-4a4a-ae2c-b9481fb16392'),(996,996,1,NULL,'__temp_lwnertfphvvauwgyrfvklnfsixfpapkltjzf',NULL,'{\"4ca0b060-ab25-4210-ba7a-04339db07b5d\": \" Datastar Map\", \"b68b894d-8c8e-4fc8-af1c-45b45dfc82d5\": {\"type\": \"entry\", \"label\": \"Read more\", \"value\": \"{entry:359@1:url}\"}, \"e3da269c-60c2-4d60-9a98-718ef293562c\": \"<p>Dynamic, data-driven maps built with Craft CMS, Datastar, and Leaflet. Features real-time marker updates, category filters, and clustering  all rendered directly in Twig.</p>\"}',1,'2025-11-07 11:43:20','2025-11-07 11:43:20','e048e6f9-9cec-4b3a-9c62-aa6ebddf1815'),(1000,1000,1,'Home','home','__home__','{\"872f39e9-c6e7-4db6-9915-33944177d829\": \"CraftCMS Lazy \\nA simple Craft CMS Starter Kit\"}',1,'2025-11-07 11:43:48','2025-11-07 11:43:48','63c2fd8d-1012-4d0f-82d7-2f27bfdc274b'),(1001,1001,1,NULL,'__temp_xkxefblkbqrrpgdsmxpjqahpwwt