y for developers to maintain, extend, and customize.</p><p>What makes this setup especially powerful is that <strong>every component can be placed anywhere within the custom </strong><a href=\\\"/layout\\\"><strong>CSS Grid layout</strong></a>, using named grid areas like content, popout, feature, or full. This gives editors complete control over structure and visual hierarchy while developers retain full semantic and performance control.</p>\"}',1,'2025-11-10 08:13:06','2025-11-10 08:13:06','1134ade9-f7d4-4c1b-b48e-14b5af658353'),(1061,1061,1,'Matrix Builder','matrix-builder','matrix-builder','{\"872f39e9-c6e7-4db6-9915-33944177d829\": \" Matrix Builder\"}',1,'2025-11-10 08:13:43','2025-11-10 08:13:43','30d867b1-7d1f-419d-bf73-0c10125fdfec'),(1062,1062,1,NULL,'__temp_igexmbvajwvcuuzsdrygzfnvhrvrckpdgpyk',NULL,'{\"54ea783f-26e8-4a98-a119-9a041012aa68\": \"<p class=\\\"ui-teaser\\\">The <strong>Matrix Builder</strong> is a visual demonstration of how Craft CMS handles flexible, component-based content through Matrix fields.</p><p>It shows how editors can create rich page layouts by combining different blocks  such as text, images, quotes, buttons, or call-to-action elements  without writing any code. Each block is powered by a reusable Twig component with consistent markup and a shared design system, making it easy for developers to maintain, extend, and customize.</p><p>What makes this setup especially powerful is that <strong>every component can be placed anywhere within the custom </strong><a href=\\\"/layout\\\"><strong>CSS Grid layout</strong></a>, using named grid areas like content, popout, feature, or full. This gives editors complete control over structure and visual hierarchy while developers retain full semantic and performance control.</p>\"}',1,'2025-11-10 08:13:43','2025-11-10 08:13:43','12c7cf99-4f87-4799-89d8-22307fcbbd14'),(1065,1065,1,'Matrix Builder','matrix-builder','matrix-builder','{\"872f39e9-c6e7-4db6-9915-33944177d829\": \" Matrix Builder\"}'