INSERT INTO `searchindex` VALUES (1,'slug',0,1,' datenschutz '),(1,'title',0,1,' datenschutz '),(3,'slug',0,1,' impressum '),(3,'title',0,1,' impressum '),(5,'field',8,1,' craftcms lazy a simple craft cms starter kit '),(5,'field',19,1,' a modern production ready craft cms starter kit with vite tailwind vue web components datastar graphql and ddev perfect for agencies and freelancers who want to build clean and fast craft sites this starter kit helps developers quickly spin up clean and maintainable craft cms projects it includes ready made examples for matrix blocks ckeditor integration a datastar powered search page and both datastar and vue based blog listings built with modern tools and clean architecture  craft cms 5 latest version with flexible content modeling  vite fast bundling and instant reloads ddev reproducible local development environment datastar lightweight reactive frontend for dynamic uis  leaflet interactive data driven maps with clustering and live filtering vue 3 web components progressive enhancement with custom elements graphql structured data fetching directly from craft tailwind css v4 utility first styling with css variables  anime js smooth element animations and scroll based transitions  craft eagerly render optimized queries automatic block templates and smart caching seo ready json ld organization schema structured data for google rich results seo meta open graph sitemap powered by seomate for share friendly pages plugins ckeditor datastar map image resizer seomate vite feel free to explore fork or contribute this starter kit is open source and available on github matrix builder build flexible page layouts using crafts matrix field each component can be placed freely within the custom grid layout system  ckeditor builder insert predefined components directly into ckeditor a simple example of combining structured elements and rich text content  datastar search fast and lightweight search using craft datastar instant results live updates